import styled from "styled-components";

export const Conteiner = styled.div`
  margin-top: 20px;
`;

export const Link = styled.a`
  display: flex;
  align-items: center;
  margin-bottom: 19px;
  font-family: "TTFirsNeue400";
  text-decoration: none;
  color: black;
`;
